import { Link } from 'react-router-dom'
import '../style/card.scss'

export default function Card({id, title, cover}) {

	return (
		<div className="gallery-card">
		<Link to={'*'} >
			><img src={cover} alt={"Kasa -" + title} />
			<h3>{title}</h3>	
		</Link>
		</div>
	)
}
